            <Nav.Link onClick={() => {}}>Event</Nav.Link>
            <Nav.Link onClick={() => {}}>Cart</Nav.Link>
            <Nav.Link onClick={() => {}}>useTransition</Nav.Link>
            <Nav.Link onClick={() => {}}>AsyncTest</Nav.Link>
          </Nav>
          <Nav className="ms-auto">
            {/* {result.isLoading ? "로딩중" : result.data.name} */}
          </Nav>
        </Container>
      </Navbar>
    </>
  );
}

export default App;
